   axios.get('https://apibyashu.herokuapp.com/api/allcakes').then((res) => {
    //    console.log("",res.data)
        const gettingcak = res.data.data;
        setCakess(gettingcak);
        setloading(false)

    })
}
 useEffect(() => {
   getAllCakes();

 }, []);

    return(
        <div className="row" style={{marginTop:'50px'}} > {
            cakess.map((each,index)=>{
